import React from "react";

export default class OrderList extends React.Component {
    render() {
        return (
            <div>
                <h1>Order List</h1>
                <div>
                    {this.props.orders.map(item => {
                        return (
                            <div key={item.fishname}>
                                <p>{item.fishname}</p>
                                <p>{item.price}</p>
                                <p>{item.stock}</p>
                                <p>{item.description}</p>
                                <p>{item.image}</p>
                            </div>
                        )
                    })}
                </div>
            </div>
        );
    }
}
